#include <bits/stdc++.h>

using namespace std::literals;

using ll = long long;

class Solution {
  public:
  static ll countPalindromePaths(const std::vector<int>& p, const std::string& s) {
    const auto n = static_cast<int>(p.size());
    std::vector<std::vector<int>> g(n);
    for (int i = 0; i < n; ++i) {
      if (p[i] != -1)
        g[p[i]].push_back(i);
    }

    ll res = 0;
    std::unordered_map<int, int> mask_freq(n);

    std::function<void(int,int)> dfs = [&](const int v, int mask) {
      {
        // 0
        const auto it = mask_freq.find(mask);
        if (it != mask_freq.end())
          res += it->second;
      }
      // 1
      for (int i = 0; i < 26; ++i) {
        mask ^= (1<<i);
        const auto it = mask_freq.find(mask);
        if (it != mask_freq.end())
          res += it->second;
        mask ^= (1<<i);
      }
      
      ++mask_freq[mask];
      for (const auto u : g[v]) {
        dfs(u, mask^(1<<(s[u]-'a')));
      }
    };
    dfs(0, 0);

    return res;
  }
};

